import React from 'react';
import { Link } from 'react-router-dom';
import BILL from './BILL';
import BMI from './BMI';
import EMI from './EMI';

const HOME = () => {
  return ( 
    <div className='container'>
     <Home/>
    <Link to='/BILL' className='btn'>BILL Calculation</Link>
    <Link to='/BMI' className='btn'>BMI Calculation</Link>
    <Link to='/EMI' className='btn'>EMI Calculation</Link>
    </div>

  )
}

export default HOME

const Home = () =>{
    return (
        <>
        <div className='container' style={home}> 

            <h1>Welcome to The Special Calculator</h1>
            <h4>Made with React JS</h4>



        </div>


        </>
    )
}

const home = {
    backgroundImage:"url(https://webartdevelopers.com/blog/wp-content/uploads/2020/06/css-particles-background.gif)",
}
